import './Header.css';
import logo from './img/mylogo.jpg';
import {Link} from "react-router-dom";

const Header = (logInState, userName) => {

    let logLink = <div>dsfsdf</div>

    return (
        <div>
            <img src={logo} className={'logo'}/>
            {logLink}
        </div>
    )

}

export default Header;
